import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Login from './Login';
import Register from './Register';
import Nav from './Nav';
import EventPage from './EventPage';

function App() {
  // Define addToCart function
  const addToCart = (eventData) => {
    // Implement your logic to add to cart here
    console.log('Added to Cart:', eventData);
  };

  return (
    <Router>
      <Routes>
        <Route path="/Login" element={<Login />} />
        <Route path="/Register" element={<Register />} />
        <Route path="/Nav" element={<Nav />} />
        {/* Pass addToCart as a prop to EventPage */}
        <Route path="/EventPage" element={<EventPage addToCart={addToCart} />} />
      </Routes>
    </Router>
  );
}

export default App;
